import React, { useState } from 'react';
import './Areas.css';

const Areas = () => {
  const [hoveredArea, setHoveredArea] = useState(null);

  const areas = [
    { id: 'mitte', name: 'Mitte', position: { top: '45%', left: '48%' } },
    { id: 'vahrenwald', name: 'Vahrenwald-List', position: { top: '28%', left: '58%' } },
    { id: 'bothfeld', name: 'Bothfeld-Vahrenheide', position: { top: '15%', left: '55%' } },
    { id: 'buchholz', name: 'Buchholz-Kleefeld', position: { top: '35%', left: '65%' } },
    { id: 'misburg', name: 'Misburg-Anderten', position: { top: '45%', left: '75%' } },
    { id: 'kirchrode', name: 'Kirchrode-Bemerode-Wülferode', position: { top: '58%', left: '70%' } },
    { id: 'sudstadt', name: 'Südstadt-Bult', position: { top: '55%', left: '52%' } },
    { id: 'dohren', name: 'Döhren-Wülfel', position: { top: '65%', left: '55%' } },
    { id: 'ricklingen', name: 'Ricklingen', position: { top: '70%', left: '45%' } },
    { id: 'ahlem', name: 'Ahlem-Limmer', position: { top: '58%', left: '32%' } },
    { id: 'linden', name: 'Linden-Limmer', position: { top: '48%', left: '35%' } },
    { id: 'nord', name: 'Nord', position: { top: '25%', left: '45%' } },
    { id: 'herrenhausen', name: 'Herrenhausen-Stöcken', position: { top: '20%', left: '32%' } }
  ];

  return (
    <section className="areas section" id="verteilgebiete">
      <div className="container">
        <h2 className="section-title">Verteilgebiete</h2>
        <p className="section-subtitle">Einsatzgebiete in der Region Hannover</p>
        
        <div className="areas-content">
          <div className="map-container">
            <div className="map-wrapper">
              {/* Map background */}
              <div className="map-background">
                <svg viewBox="0 0 800 600" xmlns="http://www.w3.org/2000/svg">
                  {/* Hannover outline - simplified representation */}
                  <path
                    d="M400,50 L500,100 L600,150 L650,250 L650,350 L600,450 L500,500 L400,520 L300,500 L200,450 L150,350 L150,250 L200,150 L300,100 Z"
                    fill="rgba(99, 102, 241, 0.05)"
                    stroke="rgba(99, 102, 241, 0.2)"
                    strokeWidth="2"
                  />
                </svg>
              </div>

              {/* Districts */}
              {areas.map((area) => (
                <div
                  key={area.id}
                  className={`district ${hoveredArea === area.id ? 'active' : ''}`}
                  style={{ top: area.position.top, left: area.position.left }}
                  onMouseEnter={() => setHoveredArea(area.id)}
                  onMouseLeave={() => setHoveredArea(null)}
                >
                  <div className="district-dot"></div>
                  <div className="district-label">{area.name}</div>
                </div>
              ))}
            </div>

            {/* Legend */}
            <div className="map-legend">
              <h4>Alle Stadtteile auf einen Blick</h4>
              <p>Bewegen Sie die Maus über die Bereiche, um Details zu sehen</p>
            </div>
          </div>

          <div className="areas-note">
            <div className="note-box">
              <h3>Umland & Region</h3>
              <p>
                Sowie Garbsen, Langenhagen, Laatzen, Lehrte und das gesamte Umland von Hannover.
              </p>
              <p>
                Wir decken die gesamte Region Hannover flächendeckend ab und garantieren eine 
                zuverlässige Zustellung in allen Gebieten.
              </p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Areas;
